INSERT INTO `articles` (`id`, `title`, `description`, `cover_image`, `content`, `created_at`, `updated_at`) VALUES
(6, 'Créer sans apport : l\'exemple de Tynkle, toujours en mode tendu sur la trésorerie', 'L\'application de dépannage informatique entre particuliers Tynkle est née à Marseille. Les deux entrepreneurs, Alain Maisonneuve et Sabri Saïd, désormais à Station F, courent après les financements.', 'data:image/jpeg;base64,', '{\"ops\":[{\"attributes\":{\"bold\":true},\"insert\":\"Créer sans apport : l\'exemple de Tynkle, toujours en mode tendu sur la trésorerie\"},{\"attributes\":{\"align\":\"center\",\"header\":1},\"insert\":\"\\n\"},{\"attributes\":{\"header\":1},\"insert\":\"\\n\"},{\"attributes\":{\"italic\":true},\"insert\":\" \"},{\"attributes\":{\"italic\":true,\"bold\":true},\"insert\":\"Eva Mignot Le 05/03/2018 à 16:37\"},{\"attributes\":{\"align\":\"center\"},\"insert\":\"\\n\\n\"},{\"insert\":{\"image\":\"data:image/jpeg;base64,\"}},{\"attributes\":{\"align\":\"center\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"L\'appli de dépannage informatique entre particuliers Tynkle est née à Marseille. Les deux entrepreneurs, Alain Maisonneuve et Sabri Saïd, désormais à Station F, courent après les financements.\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\nAlain Maisonneuve, trente-deux ans, et \"},{\"attributes\":{\"bold\":true},\"insert\":\"Sabri Saïd\"},{\"insert\":\", trente ans, ont grandi dans les quartiers nord de Marseille. \"},{\"attributes\":{\"italic\":true},\"insert\":\"« On a été en ZEP dès la maternelle »\"},{\"insert\":\", estime \"},{\"attributes\":{\"bold\":true},\"insert\":\"Alain Maisonneuve\"},{\"insert\":\". Ce qui explique sans doute leur \"},{\"attributes\":{\"link\":\"https://business.lesechos.fr/entrepreneurs/communaute/start-11018-la-debrouillardise-l-atout-des-entrepreneurs-des-quartiers-318708.php\"},\"insert\":\"sens aigü de la débrouillardise\"},{\"insert\":\" et leur envie de réussir. En janvier 2018, les deux entrepreneurs ont été sélectionnés dans le \"},{\"attributes\":{\"link\":\"https://business.lesechos.fr/entrepreneurs/communaute/0301174084304-station-f-ouvre-ses-portes-aux-startuppeurs-atypiques-317932.php\"},\"insert\":\"Fighters Program de Station F\"},{\"insert\":\" . Pendant un an, ils bénéficieront d\'un accompagnement gratuit au sein de l\'incubateur. Et pourront peut-être trouver les fonds qui leur manquent tant pour se développer.\\n\\nLorsqu\'ils décident de créer leur application de dépannage informatique entre particuliers \"},{\"attributes\":{\"bold\":true},\"insert\":\"Tynkle\"},{\"insert\":\", ils comprennent rapidement que ce projet nécessitera de lourds investissements. Avec des parents retraités docker et « tata » dans les cantines, Alain Maisonneuve ne peut pas s\'appuyer financièrement sur sa famille.\\n\\nLes deux cofondateurs lancent alors une \"},{\"attributes\":{\"link\":\"https://business.lesechos.fr/entrepreneurs/startup/start-8990-crowdfunding-les-femmes-font-mieux-mais-les-hommes-levent-plus-312012.php\"},\"insert\":\"campagne de crowdfunding\"},{\"insert\":\" et récoltent 8.000 euros. Un bon début, mais pas suffisant. La conception et le développement de l\'application leur coûtent 50.000 euros. \"},{\"attributes\":{\"italic\":true},\"insert\":\"« Nous avons eu de la chance ! Des développeurs nous ont dit qu\'une telle application coûterait aujourd\'hui entre 100.000 et 200.000 euros »\"},{\"insert\":\", assure Alain Maisonneuve. Toutes leurs économies sont alors engouffrées dans l\'application et les premières dépenses marketing. \\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Des petits boulots pour payer leurs charges\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\nTynkle a été officiellement lancé en novembre 2017. Seulement quatre mois après son lancement, un fichier de 2.000 dépanneurs avait déjà été constitué. Leur \"},{\"attributes\":{\"link\":\"https://business.lesechos.fr/entrepreneurs/gestion-finance/enrichir-son-business-plan-de-plus-d-un-modele-economique-311868.php\"},\"insert\":\"modèle économique\"},{\"insert\":\" est simple : Tynkle perçoit une commission de 30 % sur chaque transaction. Mais aujourd\'hui, leurs revenus sont loin d\'être suffisants pour faire vivre les deux entrepreneurs. \"},{\"attributes\":{\"italic\":true},\"insert\":\"« On prévoit de travailler à côté, comme surveillant en collège, par exemple »\"},{\"insert\":\", explique Alain Maisonneuve.\\n\\nDéjà à Marseille, les deux amis enchaînaient les \"},{\"attributes\":{\"bold\":true},\"insert\":\"petits boulots\"},{\"insert\":\". Sabri Saïd faisait lui-même quelques dépannages informatiques ou livrait des produits surgelés. Alain Maisonneuve, quant à lui, a travaillé comme figurant, comédien, agent administratif ou conseiller en insertion.\\n\\nToujours à la recherche de financements, ils multiplient les initiatives, par exemple s\'inscrire à plusieurs \"},{\"attributes\":{\"link\":\"https://business.lesechos.fr/entrepreneurs/financer-sa-creation/0301264764010-isymap-gagne-des-trophees-pour-financer-ses-premiers-pas-318719.php\"},\"insert\":\"concours de création d\'entreprise\"},{\"insert\":\" pour espérer décrocher quelques prix et subventions. \"},{\"attributes\":{\"italic\":true},\"insert\":\"« C\'est un énorme travail administratif : on doit sans cesse remplir des papiers, réunir les documents demandés... »\"},{\"insert\":\" précise Sabri Saïd.\\n\\nEn intégrant le Fighters Program de Station F, les deux entrepreneurs ont déménagé à Paris. La \"},{\"attributes\":{\"bold\":true},\"insert\":\"recherche de l\'appartement\"},{\"insert\":\" n\'a pas été une mince affaire. \"},{\"attributes\":{\"italic\":true},\"insert\":\"« On nous demandait des revenus au moins équivalents à trois fois le loyer »\"},{\"insert\":\", explique Alain Maisonneuve. Ils ont finalement eu de la chance : un entrepreneur compréhensif leur a loué un appartement.\\n\"}]}', '2021-03-05 14:41:32', '2021-03-06 14:47:37');
