INSERT INTO `faq_items` (`id`, `id_faq_category`, `label`, `content`, `created_at`, `updated_at`) VALUES
(1, 1, 'Conditions requises pour m’inscrire ?', 'Tout d’abord, pour le confort de la communauté, les utilisateurs qu’ils apportent ou reçoivent de l’aide se doivent de respecter le fonctionnement et les règles du site.Vous devez :Être majeur Et bien sûr, la règle principale, être sociable et courtois ;)', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(2, 1, 'Combien puis-je gagner en proposant mon dépannage ?', 'Plus vous serez disponible, plus vous gagnerez de l’argent. Vos bénéfices dépendront également d’autre critère tel que, votre réactivité.', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(3, 1, 'Est-ce payant ?', 'L’utilisation de la plateforme est 100 % gratuite, Tynkle ne prend aucune commission pour faire partie de la communauté et profitez de nombreux avantages. Lorsque votre profil est créé vous faites partie de la communauté et vous pouvez aussitôt entrer en contact avec les membres. Tynkle permet simplement une mise en relation entre membre de la communauté, les services rendus ne sont pas monétisés par Tynkle.', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(4, 1, 'Conseils utiles pour être souvent sollicité en tant qu’Helper ?', 'Répondez aux messages dès que possible, même si vous n’êtes pas en capacité de répondre aux besoins de la personne. Ajoutez une photo de vous ou d’un avatar sympa sélectionné par vos soins. Faites la pub de votre service via la communauté ! Partagez votre profil sur les réseaux-sociaux, parlez-en autour de vous.', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(5, 1, 'Comment Proposer mon dépannage ou obtenir de l’aide ?', 'Inscrivez-vous gratuitement suivez les étapes jusqu’à la fin de l’inscription.A la fin de l’inscription, vous recevrez un mail avec un lien d’activation permettant de confirmer votre compte.Vous n’avez pas reçu le mail d’activation ? Pensez à vérifier vos courriers indésirables/commerciaux s’il n’est pas présent dans votre boite de réception ou cliquez sur la bannière «Compte en attente de validation, veuillez cliquer sur le mail de confirmation, si vous ne l\'avez pas reçu cliquez ici, présente sur l’accueil du site.Votre inscription est maintenant terminée, vous pouvez dès à présent vous lancer !', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(6, 1, 'Mon compte', 'Ici vous pouvez apporter des modifications concernant les réglages de votre compte et vos informations en vous rendant dans Mon Compte. Vous pouvez également accéder à votre compte en appuyant le bouton « mon Compte » sur la barre de navigation ou la barre latérale à partir d’un smartphone. Il vous sera également possible de supprimer votre compte, ce qui comprend toutes les informations renseignées.', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(7, 1, 'Compétences', 'Attachez une importance à vos compétences, cela représente l’un des éléments clés de votre succès. Vous avez la possibilité de les modifier dans Mon Compte/Compétences, n’oubliez pas d’enregistrer ensuite.', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(8, 1, 'Les petits plus du membre sympa', 'Entre membre, lorsque vous rentrez en contact, prenez le temps de bien vous renseigner sur le problème ou d’expliquer votre problème, le dépannage n’en sera que plus efficace. Faites-en sorte d’arriver à l’heure sur le lieu de rendez-vous, en prenant en compte les aléas de la circulation.', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(9, 2, 'J’ai reçu une demande', 'Vous avez reçu votre première demande de dépannage, voilà comment ça marche. Il est primordial d’y répondre le plus rapidement possible. Celle-ci se manifestera par une notification qui sera visible sur la cloche située sur l’Accueil à partir d’un ordinateur ou sur la barre latérale à partir d’un smartphone. Vous avez également la possibilité d’être alerté par mail. En consultant une demande vous avez une explication du problème et le détail de l’appareil. Il vous faut ensuite discuter avec le demandeur afin de convenir d’un éventuel rendez-vous.En consultant une demande vous avez une explication du problème et le détail de l’appareil. Il vous faut ensuite discuter avec le demandeur afin de convenir d’un éventuel rendez-vous.', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(10, 2, 'Messagerie', 'Sur votre messagerie vous retrouvez tous les échanges avec les demandeurs signalés par une notification.', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(11, 3, 'A mon départ', 'Après la prestation pensez à préciser à la personne dépannée de vous évaluer afin que cela puisse vous servir pour d’autres prestations.', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(12, 4, 'Comment faire une demande de dépannage ?', 'Vous pouvez publier une annonce présentant votre problème afin que des Helpers puissent la consulter en fonction de leurs compétences.Vous pouvez rechercher un Helper ayant les compétences pour vous aider. Pour un service optimal activer votre géolocalisation dans les paramètres de réglages de votre smartphone ou votre navigateur web sur votre ordinateur et/ou précisez votre adresse dans &lt;Mon compte&gt;. Tynkle se charge de vous proposer des helpers pouvant répondre à votre demande à partir de votre besoin.Envoyez une demande.Après avoir trouvé un helper qui correspond à vos critères de recherche, vous pouvez lui envoyer une demande. Pour être certain d’avoir au moins une réponse positive vous pouvez envoyer votre demande en sélectionnant plusieurs helpers, ou un seul si au préalable vous l’aviez ajouté à vos favoris.', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(13, 5, 'Favoris', 'Ici vous retrouverez tous les Helpers que vous avez ajoutés dans vos favoris. Vous pouvez ajouter et retirer un Helper de vos favoris directement depuis son profil en appuyant sur Favoris', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(14, 5, 'Modification / Annulation.', 'Vous avez un empêchement quelconque qui ne vous permet pas d’être présent(e) le jour du rendez-vous ? Via la messagerie, vous avez la possibilité de communiquer à la personne alors n’hésitez pas à vous s’en servir si vous avez fait le choix de ne pas échanger vos numéros de téléphone.', '2021-03-08 11:28:06', '0000-00-00 00:00:00'),
(15, 6, 'Contact', 'Vous souhaitez envoyer un message à Tynkle, ce dernier sera traité le plus rapidement possible, tenant compte des jours ouvrés.', '2021-03-08 11:28:06', '0000-00-00 00:00:00');
