INSERT INTO `rules` (`id`, `content`, `created_at`, `updated_at`) VALUES
(1, '{\"ops\":[{\"attributes\":{\"align\":\"center\",\"header\":1},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Conditions générales\"},{\"attributes\":{\"align\":\"center\",\"header\":1},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Conditions Générales | \"},{\"attributes\":{\"bold\":true,\"link\":\"https://www.blablacar.fr/about-us/privacy-policy\"},\"insert\":\"Politique de Confidentialité\"},{\"attributes\":{\"bold\":true},\"insert\":\" | \"},{\"attributes\":{\"bold\":true,\"link\":\"https://www.blablacar.fr/about-us/cookies-policy\"},\"insert\":\"Utilisation des Cookies\"},{\"attributes\":{\"align\":\"center\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Version applicable à compter du 22 mai 2019\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"1. Objet\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"La société Comuto SA (ci-après, « BlaBlaCar ») édite une plateforme de covoiturage accessible sur un site internet notamment à l’adresse www.blablacar.fr ou sous forme d’application mobile et destinée à (i) mettre en relation des conducteurs se rendant à une destination donnée pour leur propre compte avec des passagers allant dans la même direction afin de leur permettre de partager le trajet et donc les frais qui y sont associés et (ii) réserver des places pour des liaisons en bus auprès d’Autocaristes autorisés par BlaBlaCar à publier certains trajets sur la plateforme (ci-après, la « Plateforme »).\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Les présentes conditions générales d’utilisation ont pour objet d’encadrer l’accès et les modalités d’utilisation de la Plateforme. Nous vous invitons à en prendre attentivement connaissance. Vous comprenez et reconnaissez que BlaBlaCar n’est partie à aucun accord, contrat ou relation contractuelle, de quelque nature que ce soit, conclu entre les Membres de sa Plateforme ou avec un Autocariste.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En cliquant sur le bouton « Connexion avec Facebook » ou « Inscription avec un email », vous reconnaissez avoir pris connaissance et accepter l’intégralité des présentes conditions générales d’utilisation.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"2. Définitions\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Dans les présentes,\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Annonce » désigne indistinctement une Annonce de Covoiturage ou une Annonce de Bus ;\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Annonce de Covoiturage » désigne une annonce concernant un Trajet posté sur la Plateforme par un Conducteur ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Annonce de Bus » désigne une annonce concernant un Trajet en Bus posté sur la Plateforme par un Autocariste ;\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Autocariste » désigne une entreprise de transport de passagers professionnelle autorisée par BlaBlaCar à publier certains Trajets en Bus sur la Plateforme ;\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« BlaBlaCar » a la signification qui lui est donnée à l’article 1 ci-dessus ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« CGU » désigne les présentes Conditions Générales d’Utilisation ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Compte » désigne le compte qui doit être créé pour pouvoir devenir Membre et accéder à certains services proposés par la Plateforme ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Compte Facebook » a la signification qui lui est donné à l’article 3.2 ci-dessous ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Conducteur » désigne le Membre proposant, sur la Plateforme, de transporter une autre personne physique en contrepartie de la Participation aux Frais, pour un trajet et un horaire défini par lui-seul ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Confirmation de Réservation » a la signification qui lui est donnée à l’article 4.2.1 ci-dessous ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Contenu Membre » a la signification qui lui est donnée à l’article 11.2 ci-dessous ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Frais de Service » a la signification qui lui est donnée à l’article 5.2 ci-dessous ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Membre » désigne toute personne physique ayant créé un Compte sur la Plateforme ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Passager » désigne le Membre ayant accepté la proposition d’être transporté par le Conducteur ou, le cas échéant, la personne pour le compte de laquelle un Membre a réservé une Place ou par l’Autocariste ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Participation aux Frais » désigne, pour un Trajet en Covoiturage donné, la somme d’argent demandée par le Conducteur et acceptée par le Passager au titre de sa participation aux frais de déplacement ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Place » désigne la place réservée par un Passager à bord du véhicule d’un Conducteur ou à bord d’un véhicule opéré par un Autocariste ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Plateforme » a le sens qui lui est donné à l’article 1, ci-dessus ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Prix » désigne, pour un Trajet en Bus donné, le prix toutes taxes comprises demandé par l’Autocariste pour une place à bord dudit véhicule ;\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Réservation » a le sens qui lui est donné à l’article 4.2.1. ci-dessous ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Services » désigne l’ensemble des services rendus par BlaBlaCar par l’intermédiaire de la Plateforme ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Site » désigne le site internet accessible à l’adresse www.blablacar.fr ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Sous-Trajet » a le sens qui lui est donné à l’article 4.1 ci-dessous ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Trajet » désigne indistinctement un Trajet en Covoiturage ou un Trajet en Bus\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Trajet en Covoiturage » désigne le trajet faisant l’objet d’une Annonce de Covoiturage publiée par un Conducteur sur la Plateforme et pour lequel il accepte de transporter des Passagers en contrepartie de la Participation aux Frais ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"« Trajet en Bus » désigne le trajet faisant l’objet d’une Annonce de Bus publiée par un Autocariste sur la Plateforme et pour lequel il propose des places à bord du véhicule à la vente en contrepartie du Prix.\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"3. Inscription à la Plateforme et création de Compte\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"3.1. Conditions d’inscription à la Plateforme\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"L’utilisation de Plateforme est réservée aux personnes physiques âgées de 18 ans ou plus. Toute inscription sur la Plateforme par une personne mineure est strictement interdite. En accédant, utilisant ou vous inscrivant sur la Plateforme, vous déclarez et garantissez avoir 18 ans ou plus.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"3.2. Création de Compte\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"La Plateforme permet aux Membres de publier des Annonces de Covoiturage et consulter des Annonces ainsi que d’interagir entre eux pour la réservation de Place. Vous pouvez consulter les Annonces même si vous n’êtes pas inscrit sur la Plateforme. En revanche, vous ne pouvez ni publier une Annonce de Covoiturage ni réserver une Place sans avoir, au préalable, créé un Compte et être devenu Membre.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Pour créer votre Compte, vous pouvez :\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(i) soit remplir l’ensemble des champs obligatoires figurant sur le formulaire d’inscription ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ii) soit vous connecter, via notre Plateforme, à votre compte Facebook (ci-après, votre « Compte Facebook »). En utilisant une telle fonctionnalité, vous comprenez que BlaBlaCar aura accès, publiera sur la Plateforme et conservera certaines informations de votre Compte Facebook. Vous pouvez à tout moment supprimer le lien entre votre Compte et votre Compte Facebook par l’intermédiaire de la rubrique « Vérifications » de votre profil. Si vous souhaitez en savoir plus sur l’utilisation de vos données dans le cadre de votre Compte Facebook, consultez notre \"},{\"attributes\":{\"bold\":true,\"link\":\"https://www.blablacar.fr/about-us/privacy-policy\"},\"insert\":\"Politique de Confidentialité\"},{\"attributes\":{\"bold\":true},\"insert\":\" et celle de Facebook.\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Pour vous inscrire sur la Plateforme, vous devez avoir lu et accepter les présentes CGU ainsi que la \"},{\"attributes\":{\"bold\":true,\"link\":\"https://www.blablacar.fr/about-us/privacy-policy\"},\"insert\":\"Politique de Confidentialité\"},{\"attributes\":{\"bold\":true},\"insert\":\".\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"A l’occasion de la création de votre Compte, et ce quelle que soit la méthode choisie pour ce faire, vous vous engagez à fournir des informations personnelles exactes et conformes à la réalité et à les mettre à jour, par l’intermédiaire de votre profil ou en en avertissant BlaBlaCar, afin d’en garantir la pertinence et l’exactitude tout au long de votre relation contractuelle avec BlaBlaCar.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En cas d’inscription par email, vous vous engagez à garder secret le mot de passe choisi lors de la création de votre Compte et à ne le communiquer à personne. En cas de perte ou divulgation de votre mot de passe, vous vous engagez à en informer sans délai BlaBlaCar. Vous êtes seul responsable de l’utilisation faite de votre Compte par un tiers, tant que vous n’avez pas expressément notifié BlaBlaCar de la perte, l’utilisation frauduleuse par un tiers ou la divulgation de votre mot de passe à un tiers.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous vous engagez à ne pas créer ou utiliser, sous votre propre identité ou celle d’un tiers, d’autres Comptes que celui initialement créé.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"3.3. Vérification\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar peut, à des fins de transparence, d’amélioration de la confiance, ou de prévention ou détection des fraudes, mettre en place un système de vérification de certaines des informations que vous fournissez sur votre profil. C’est notamment le cas lorsque vous renseignez votre numéro de téléphone ou nous fournissez une pièce d’identité.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous reconnaissez et acceptez que toute référence sur la Plateforme ou les Services à des informations dites « vérifiées » ou tout terme similaire, signifie uniquement qu’un Membre a réussi avec succès la procédure de vérification existante sur la Plateforme ou les Services afin de vous fournir davantage d’informations sur le Membre avec lequel vous envisagez de voyager. BlaBlaCar ne garantit ni la véracité, ni la fiabilité, ni la validité de l’information ayant fait l’objet de la procédure de vérification.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"4. Utilisation des Services\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"4.1. Publication des Annonces de Covoiturage\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En tant que Membre, et sous réserve que vous remplissiez les conditions ci-dessous, vous pouvez créer et publier des Annonces de Covoiturage sur la Plateforme en indiquant des informations quant au Trajet en Covoiturage que vous comptez effectuer (dates/heures et lieux de départ et d’arrivée, nombre de places offertes, options proposées, montant de la Participation aux Frais, etc.).\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Lors de la publication de votre Annonce de Covoiturage, vous pouvez indiquer des villes étapes, dans lesquelles vous acceptez de vous arrêter pour prendre ou déposer des Passagers. Les tronçons du Trajet en Covoiturage entre ces villes étapes ou entre l’une de ces villes étapes et le point de départ ou d’arrivée du Trajet en Covoiturage constituent des « Sous-Trajets ».\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous n’êtes autorisé à publier une Annonce de Covoiturage que si vous remplissez l’ensemble des conditions suivantes :\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(i) vous êtes titulaire d’un permis de conduire valide ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ii) vous ne proposez des Annonces de Covoiturage que pour des véhicules dont vous êtes le propriétaire ou que vous utilisez avec l’autorisation expresse du propriétaire, et dans tous les cas, que vous êtes autorisés à utiliser à des fins de covoiturage ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iii) vous êtes et demeurez le conducteur principal du véhicule, objet de l’Annonce de Covoiturage ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iv) le véhicule bénéficie d’une assurance au tiers valide ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(v) vous n’avez aucune contre-indication ou incapacité médicale à conduire ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(vi) le véhicule que vous comptez utiliser pour le Trajet est une voiture de tourisme à 4 roues, disposant d’un maximum de 7 places assises, à l’exclusion des voitures dites « sans permis » ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(vii) vous ne comptez pas publier une autre annonce pour le même Trajet en Covoiturage sur la Plateforme ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(viii) vous n’offrez pas plus de Places que celles disponibles dans votre véhicule ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ix) toutes les Places offertes ont une ceinture de sécurité, et ce même si le véhicule est homologué en présence de sièges dépourvus de ceinture de sécurité ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(x) vous utilisez un véhicule en parfait état de fonctionnement et conforme aux usages et dispositions légales applicables, notamment avec un contrôle technique à jour ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(xi) vous êtes un consommateur et n’agissez pas à titre professionnel.\"},{\"attributes\":{\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous reconnaissez être le seul responsable du contenu de l’Annonce de Covoiturage que vous publiez sur la Plateforme. En conséquence, vous déclarez et garantissez l’exactitude et la véracité de toute information contenue dans votre Annonce de Covoiturage et vous engagez à effectuer le Trajet en Covoiturage selon les modalités décrites dans votre Annonce de Covoiturage.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Votre Annonce de Covoiturage sera publiée sur la Plateforme et donc visible des Membres et de tous visiteurs, même non Membre, effectuant une recherche sur la Plateforme ou sur le site internet des partenaires de BlaBlaCar. BlaBlaCar se réserve la possibilité, à sa seule discrétion et sans préavis, de ne pas publier ou retirer, à tout moment, toute Annonce de Covoiturage qui ne serait pas conforme aux CGU ou qu’elle considérerait comme préjudiciable à son image, celle de la Plateforme ou celle des Services.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous êtes également informés de ce que dans le cas où vous vous présenteriez en tant que consommateur en utilisant la Plateforme alors que vous agissez en réalité à titre professionnel vous vous exposez aux sanctions prévues à l’article \"},{\"attributes\":{\"bold\":true,\"link\":\"https://www.legifrance.gouv.fr/affichCodeArticle.do?cidTexte=LEGITEXT000006069565&idArticle=LEGIARTI000032221105&dateTexte=&categorieLien=cid\"},\"insert\":\"L.132-2 du Code de la consommation\"},{\"attributes\":{\"bold\":true},\"insert\":\".\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"4.2. Réservation d’une Place\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar a mis en place un système de réservation de Places en ligne (la « Réservation ») pour les Trajets proposés sur la Plateforme.\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Les modalités de réservation d’une Place dépendent de la nature du Trajet envisagé.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"4.2.1. Trajet en Covoiturage\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Lorsqu’un Passager est intéressé par une Annonce de Covoiturage, il peut effectuer une demande de Réservation en ligne. Cette demande de Réservation est (i) soit acceptée automatiquement (si le Conducteur a choisi cette option lors de la publication de son Annonce de Covoiturage), (ii) soit acceptée manuellement par le Conducteur. Au moment de la Réservation, le Passager procède au paiement en ligne du montant de la Participation aux Frais et des Frais de Service afférents, le cas échéant. Après vérification du paiement par BlaBlaCar et validation de la demande de Réservation par le Conducteur, le cas échéant, le Passager reçoit une confirmation de réservation (la « Confirmation de Réservation »).\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Si vous êtes un Conducteur et que vous avez choisi de gérer vous-mêmes les demandes de Réservation lors de la publication de votre Annonce de Covoiturage, vous êtes tenu de répondre à toute demande de Réservation dans un certain délai. A défaut, la demande de Réservation expire automatiquement et le Passager est remboursé de l’intégralité des sommes versées au moment de la demande de Réservation, le cas échéant.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"A compter de la Confirmation de la Réservation, BlaBlaCar vous transmet les coordonnées téléphoniques du Conducteur (si vous êtes Passager) ou du Passager (si vous êtes Conducteur), dans le cas où le Membre a donné son accord à la divulgation de son numéro de téléphone. Vous êtes désormais seuls responsables de l’exécution du contrat vous liant à l’autre Membre.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"4.2.2. Trajet en Bus\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Pour les Trajets en Bus, BlaBlaCar propose de réserver un billet pour un Trajet en Bus donné par l’intermédiaire de la Plateforme. BlaBlaCar ne fournit pas de service de transport dans le cadre du Trajet en Bus, les Autocaristes étant seuls parties au contrat de transport. Vous reconnaissez que la réservation de Places pour un Trajet en Bus donné est soumise aux conditions générales de l’Autocariste concerné.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"4.2.3. Caractère nominatif de la réservation de Place et modalités d’utilisation des Services pour le compte d’un tiers\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Toute utilisation des Services, que ce soit en qualité de Passager ou de Conducteur, est nominative. Le Conducteur comme le Passager doivent correspondre à l’identité communiquée à BlaBlaCar et aux autres Membres participant au Trajet de Covoiturage ou à l’Autocariste, le cas échéant..\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Toutefois, BlaBlaCar permet à ses Membres de réserver une ou plusieurs Places pour le compte d’un tiers. Dans ce cas, vous vous engagez à indiquer avec exactitude au Conducteur ou à l’Autocariste, au moment de la Réservation, les prénom, âge et numéro de téléphone de la personne pour le compte de laquelle vous réservez une Place. Il est strictement interdit de réserver une Place pour un mineur voyageant seul âgé de moins de 13 ans pour un Trajet en Covoiturage. Dans le cas où vous réservez une Place pour un Trajet en Covoiturage pour un mineur voyageant seul âgé de plus de 13 ans, vous vous engagez à demander l’accord préalable du Conducteur et à lui fournir une autorisation des représentants légaux dûment remplie et signée. En ce qui concerne un Trajet en Bus, nous vous invitons à prendre connaissance des conditions générales de l’Autocariste concerné.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En outre, la Plateforme est destinée à la réservation de Places pour des personnes physiques. Il est donc interdit de réserver une Place pour le transport d’un objet, colis, d’un animal voyageant seul ou tout élément matériel.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Par ailleurs, il est interdit de publier une Annonce de Covoiturage pour un Conducteur autre que vous-même.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"4.3. Système d’avis\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"4.3.1. Fonctionnement\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar vous encourage à laisser un avis sur un Conducteur ou un Autocariste (si vous êtes Passager) ou un Passager (si vous êtes Conducteur) avec lequel vous avez partagé un Trajet ou avec lequel vous étiez censé partager un Trajet. En revanche, vous n’êtes pas autorisé à laisser un avis sur un autre Passager, si vous étiez vous-même Passager, ni sur un Membre avec lequel vous n’avez pas voyagé ou avec lequel vous n’étiez pas censé voyager.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Votre avis, ainsi que celui laissé par un autre Membre à votre égard, le cas échéant, ne sont visibles et publiés sur la Plateforme qu’après le plus court des délais suivants : (i) immédiatement après que vous ayez, tous les deux, laissés un avis ou (ii) passé un délai de 14 jours après le premier avis laissé.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous avez la possibilité de répondre à un avis qu’un autre Membre a laissé sur votre profil dans un délai maximum de 14 jours suivant la publication de l’avis laissé à votre égard. L’avis et votre réponse, le cas échéant, seront publiés sur votre profil.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"4.3.2. Modération\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous reconnaissez et acceptez que BlaBlaCar se réserve la possibilité de ne pas publier ou supprimer tout avis, toute question, tout commentaire ou toute réponse dont elle jugerait le contenu contraire aux présentes CGU.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"4.3.3. Seuil\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar se réserve la possibilité de suspendre votre Compte, limiter votre accès aux Services ou résilier les présentes CGU dans le cas où (i) vous avez reçu au moins trois avis et (ii) la moyenne des avis que vous avez reçus est égale ou inférieure à 3.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"5. Conditions financières\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"L’accès et l’inscription à la Plateforme, de même que la recherche, la consultation et la publication d’Annonces sont gratuits. En revanche, la Réservation est payante dans les conditions décrites ci-dessous.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"5.1. Participation aux Frais et Prix\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"5.1.1. Dans le cadre d’un Trajet en Covoiturage, le montant de la Participation aux Frais est déterminé par vous, en tant que Conducteur, sous votre seule responsabilité. Il est strictement interdit de tirer le moindre bénéfice du fait de l’utilisation de notre Plateforme. Par conséquent, vous vous engagez à limiter le montant de la Participation aux Frais que vous demandez à vos Passagers aux frais que vous supportez réellement pour effectuer le Trajet en Covoiturage. A défaut, vous supporterez seul les risques de requalification de l’opération effectuée par l’intermédiaire de la Plateforme.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Lorsque vous publiez une Annonce de Covoiturage, BlaBlaCar vous suggère un montant de Participation aux Frais qui tient compte notamment de la nature du Trajet en Covoiturage et de la distance parcourue. Ce montant est purement indicatif et il vous appartient de le modifier à la hausse ou à la baisse pour tenir compte des frais que vous supportez réellement sur le Trajet en Covoiturage. Afin d’éviter les abus, BlaBlaCar limite les possibilités d’ajustement du montant de la Participation aux Frais.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"5.1.2. En ce qui concerne les Trajets en Bus, le Prix par Place est fixé à sa seule discrétion par l’Autocariste.\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"5.2. Frais de Service\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar peut prélever, en contrepartie de l’utilisation de la Plateforme, des frais de service à ses utilisateurs (ci après, les “Frais de Service”). L’utilisateur sera informé avant toute application de Frais de Service le cas échéant. \"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Les modalités de calcul des Frais de Service en vigueur accessibles \"},{\"attributes\":{\"bold\":true,\"link\":\"https://blog.blablacar.fr/blablalife/lp/les-frais-de-service\"},\"insert\":\"ici\"},{\"attributes\":{\"bold\":true},\"insert\":\" sont fournies à titre informatif uniquement et n’ont pas de valeur contractuelle. BlaBlaCar se réserve le droit de modifier à tout moment les modalités de calcul des Frais de Service. Ces modifications n’auront pas d’effet sur les Frais de Service acceptés par les utilisateurs avant la date de prise d’effet de ces modifications.\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En ce qui concerne les trajets transfrontaliers, les modalités de calcul du montant des Frais de Services et des taxes applicables varient selon la résidence du Membre.\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Lorsque vous utilisez la Plateforme pour des Trajets transfrontaliers ou hors de France, les Frais de Services peuvent être facturés par une société affiliée de BlaBlaCar éditant la plateforme locale.\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"5.3. Arrondis\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous reconnaissez et acceptez que BlaBlaCar peut, à son entière discrétion, arrondir au chiffre inférieur ou supérieur les Frais de Service et la Participation aux Frais.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"5.4. Modalités de paiement et de reversement de la Participation aux Frais au Conducteur ou du Prix au Autocaristes\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"5.4.1. Mandat d’encaissement\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En utilisant la Plateforme en tant que Conducteur pour des Trajets avec Réservation, vous confiez à BlaBlaCar un mandat d’encaissement du montant de la Participation aux Frais en votre nom et pour votre compte.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Par conséquent, dans le cadre d’un Trajet en Covoiturage, et après acceptation manuelle ou automatique de la Réservation, BlaBlaCar encaisse la totalité de la somme versée par le Passager (Frais de Service et Participation aux Frais).\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Les Participations aux Frais reçues par BlaBlaCar sont déposées sur un compte dédié au paiement des Conducteurs.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous reconnaissez et acceptez qu’aucune des sommes perçues par BlaBlaCar au nom et pour le compte du Conducteur n’emporte droit à intérêts. Vous acceptez de répondre avec diligences à toute demande de BlaBlaCar et plus généralement de toute autorité administrative ou judiciaire compétente en particulier en matière de prévention ou la lutte contre le blanchiment. Notamment, vous acceptez de fournir, sur simple demande, tout justificatif d’adresse et/ou d’identité utile.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En l’absence de réponse de votre part à ces demandes, BlaBlaCar pourra prendre toute mesure qui lui semblera appropriée notamment le gel des sommes versées et/ou la suspension de votre Compte et/ou la résiliation des présentes CGU.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"5.4.2. Versement de la Participation aux Frais au Conducteur\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"A la suite du Trajet en Covoiturage, les Passagers disposent d’un délai de 24 heures pour présenter une réclamation à BlaBlaCar . En l’absence de contestation de leur part dans cette période, BlaBlaCar considère la confirmation du Trajet comme acquise.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"A compter de cette confirmation expresse ou tacite, vous disposez, en tant que Conducteur, d’un crédit exigible sur votre Compte. Ce crédit correspond au montant total payé par le Passager au moment de la confirmation de la Réservation diminué des Frais de Service, c’est-à-dire au montant de la Participation aux Frais payée par le Passager.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Lorsque le Trajet en Covoiturage est confirmé par le Passager, vous avez la possibilité, en tant que Conducteur, de donner instructions à BlaBlaCar de vous verser l’argent sur votre compte bancaire (en renseignant sur votre Compte, au préalable, vos coordonnées bancaires) ou votre compte Paypal (en renseignant sur votre Compte, au préalable, votre adresse email Paypal).\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"L’ordre de virement à votre nom sera transmis le premier jour ouvré suivant votre demande ou à défaut de demande de votre part, le premier jour ouvré suivant la mise à disposition sur votre profil des sommes concernées (sous réserve que BlaBlaCar dispose de vos informations bancaires).\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"A l’issue du délai de prescription de 5 ans applicable, toute somme non réclamée à BlaBlaCar sera réputée appartenir à BlaBlaCar.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"5.4.3. Versement du Prix à l’Autocariste \"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"A la suite du Trajet en Bus, vous disposez d’un délai de 24 heures pour présenter une réclamation à BlaBlaCar. En l’absence de contestation de votre part, BlaBlaCar considère la confirmation du Trajet en Bus comme acquise et versera le Prix à l’Autocariste.\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"6. Finalité non commerciale et non professionnelle de l’utilisation par des Conducteurs des Services et de la Plateforme\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous vous engagez à n’utiliser les Services et la Plateforme que pour être mis en relation, à titre non professionnel et non commercial, avec des personnes souhaitant partager un Trajet en Covoiturage avec vous ou pour réserver une Place dans le cadre d’un Trajet en Bus.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En tant que Conducteur, vous vous engagez à ne pas demander une Participation aux Frais supérieure aux frais que vous supportez réellement et susceptible de vous faire générer un bénéfice, étant précisé que s’agissant d’un partage de frais, vous devez également, en tant que Conducteur, supporter votre part des coûts afférents au Trajet en Covoiturage. Vous êtes seul responsable d’effectuer le calcul des frais que vous supportez pour le Trajet en Covoiturage, et de vous assurer que le montant demandé à vos Passagers n’excède pas les frais que vous supportez réellement (en excluant votre part de participation aux frais), notamment en vous référant au barème fiscal kilométrique forfaitaire applicable.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar se réserve la possibilité de suspendre votre Compte dans le cas où vous utiliseriez un véhicule professionnel de type VTC ou taxi, une voiture de fonction ou de service et généreriez de ce fait un bénéfice sur la Plateforme. Vous vous engagez à fournir à BlaBlaCar, sur simple demande de la part de celle-ci, une copie de votre carte grise et/ou tout autre document de nature à attester que vous êtes autorisé à utiliser ce véhicule sur la Plateforme et n’en tirez aucun bénéfice.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar se réserve également la possibilité de suspendre votre Compte, limiter votre accès aux Services ou résilier les présentes CGU en cas d’activité de votre part sur la Plateforme, qui, du fait de la nature des trajets proposés, de leur fréquence, du nombre de Passagers transportés ou du montant de Participation aux Frais demandé, entrainerait une situation de bénéfice pour vous ou pour quelque raison que ce soit faisant suspecter à BlaBlaCar que vous générez un bénéfice sur la Plateforme.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"7. Politique d’annulation\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"7.1. Modalités de remboursement en cas d’annulation\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Seuls les Trajets en Covoiturage font l’objet de la présente politique d’annulation, BlaBlaCar n’offrant aucune garantie, de quelque nature que ce soit, en cas d’annulation, pour quelque raison que ce soit. Dans le cadre des Trajets en Bus, celle-ci étant soumise aux conditions générales d’utilisation des Autocaristes. Nonobstant ce qui précède, en cas d’annulation par un Passager d’une Place dans le cadre d’un Trajet en Bus, les Frais de Services resteront acquis à BlaBlaCar.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"L’annulation d’une Place d’un Trajet en Covoiturage par le Conducteur ou le Passager après la Confirmation de Réservation est soumise aux stipulations ci-après :\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"– En cas d’annulation imputable au Conducteur, le Passager est remboursé de la totalité de la somme qu’il a versée (c’est-à-dire la Participation aux Frais et les Frais de Service afférents). C’est notamment le cas lorsque le Conducteur annule un Trajet en Covoiturage ou ne se rend pas au point de rendez-vous au plus tard 15 minutes après l’horaire convenu ;\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"– En cas d’annulation imputable au Passager :\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Si le Passager annule plus de 24 heures avant l’heure prévue pour le départ telle que mentionnée dans l’Annonce de Covoiturage, le Passager est remboursé du montant de la Participation aux Frais. Les Frais de Service demeurent acquis à BlaBlaCar et le Conducteur ne reçoit aucune somme de quelque nature que ce soit ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Si le Passager annule moins de 24 heures ou 24 heures avant l’heure prévue pour le départ, telle que mentionnée dans l’Annonce de Covoiturage et plus de trente minutes après la Confirmation de Réservation, le Passager est remboursé à hauteur de la moitié de la Participation aux Frais versée lors de la Réservation, les Frais de Service demeurent acquis à BlaBlaCar et le Conducteur reçoit 50% de la Participation aux Frais ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Si le Passager annule moins de 24 heures ou 24 heures avant l’heure prévue pour le départ, telle que mentionnée dans l’Annonce de Covoiturage et trente minutes ou moins après la Confirmation de Réservation, le Passager est remboursé de l’intégralité de la Participation aux Frais. Les Frais de Service demeurent acquis à BlaBlaCar et le Conducteur ne reçoit aucune somme de quelque nature que ce soit ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Si le Passager annule après l’heure prévue pour le départ, telle que mentionnée dans l’Annonce, ou s’il ne se présente pas au lieu de rendez-vous au plus tard dans un délai de 15 minutes à compter de l’heure convenue, aucun remboursement n’est effectué. Le Conducteur est dédommagé à hauteur de la totalité de la Participation aux Frais et les Frais de Services sont conservés par BlaBlaCar.\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Lorsque l’annulation intervient avant le départ et du fait du Passager, la ou les Places annulé(e)s par le Passager pour ledit Trajet en Covoiturage sont de plein droit remises à la disposition d’autres Passagers pouvant les réserver en ligne et en conséquence soumises aux conditions des présentes CGU.\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar apprécie à sa seule discrétion, sur la base des éléments à sa disposition, la légitimité des demandes de remboursement qu’elle reçoit.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"7.2. Droit de rétraction\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En acceptant les présentes CGU, vous acceptez expressément que le Contrat entre vous et BlaBlaCar consistant en la mise en relation avec un autre Membre soit exécuté avant l’expiration du délai de rétractation dès la Confirmation de Réservation et renoncez expressément à votre droit de rétraction, conformément aux dispositions de l’article L.221-28 du Code de la consommation.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"8. Comportement des utilisateurs de la Plateforme et Membres\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"8.1. Engagement de tous les utilisateurs de la Plateforme\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous reconnaissez être seul responsable du respect de l’ensemble des lois, règlements et obligations applicables à votre utilisation de la Plateforme.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Par ailleurs, en utilisant la Plateforme et lors des Trajets, vous vous engagez à :\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(i) ne pas utiliser la Plateforme à des fins professionnelles, commerciales ou lucratives si vous n’êtes pas un Autocaristes ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ii) ne transmettre à BlaBlaCar (notamment lors de la création ou la mise à jour de votre Compte) ou aux autres Membres ou Autocaristes aucune information fausse, trompeuse, mensongère ou frauduleuse ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iii) ne tenir aucun propos, n’avoir aucun comportement ou ne publier sur la Plateforme aucun contenu à caractère diffamatoire, injurieux, obscène, pornographique, vulgaire, offensant, agressif, déplacé, violent, menaçant, harcelant, raciste, xénophobe, à connotation sexuelle, incitant à la violence, à la discrimination ou à la haine, encourageant les activités ou l’usage de substances illégales ou, plus généralement, contraires aux finalités de la Plateforme, de nature à porter atteinte aux droits de BlaBlaCar ou d’un tiers ou contraires aux bonnes mœurs ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iv) ne pas porter atteinte aux droits et à l’image de BlaBlaCar, notamment à ses droits de propriété intellectuelle ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(v) ne pas ouvrir plus d’un Compte sur la Plateforme et ne pas ouvrir de Compte au nom d’un tiers ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(vi) ne pas tenter de contourner le système de réservation en ligne de la Plateforme, notamment en tentant de communiquer à un autre Membre ou un Autocariste vos coordonnées afin de réaliser la réservation en dehors de la Plateforme et ne pas payer les Frais de Service ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(vii) ne pas contacter un autre Membre ou Autocariste, notamment par l’intermédiaire de la Plateforme, à une autre fin que celle de définir les modalités du covoiturage ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(viii) ne pas accepter ou effectuer un paiement en dehors de la Plateforme ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ix) vous conformer aux présentes CGU et à la Politique de Confidentialité.\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"8.2. Engagements des Conducteurs\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En outre, lorsque vous utilisez la Plateforme en tant que Conducteur, vous vous engagez à :\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(i) respecter l’ensemble des lois, règles, codes applicables à la conduite et au véhicule, notamment à disposer d’une assurance responsabilité civile valide au moment du Trajet en Covoiturage et être en possession d’un permis de conduire en vigueur ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ii) vous assurer que votre assurance couvre le covoiturage et que vos Passagers sont considérés comme tiers dans votre véhicule et donc couverts par votre assurance ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iii) ne prendre aucun risque au volant, à n’absorber aucun produit de nature à altérer votre attention et vos capacités, à conduire avec vigilance et en toute sécurité ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iv) publier des Annonces de Covoiturage correspondant uniquement à des trajets réellement envisagés ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(v) effectuer le Trajet en Covoiturage tel que décrit dans l’Annonce de Covoiturage (notamment en ce qui concerne l’emprunt ou non de l’autoroute) et respecter les horaires et lieux convenus avec les autres Membres (notamment lieu de rendez-vous et de dépose) ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(vi) ne pas prendre plus de Passagers que le nombre de Places indiquées dans l’Annonce de Covoiturage ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(vii) utiliser un véhicule en parfait état de fonctionnement et conforme aux usages et dispositions légales applicables, notamment avec un contrôle technique à jour ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(viii) communiquer à BlaBlaCar ou tout Passager qui vous en fait la demande, votre permis de conduire, votre carte grise, votre attestation d’assurance, votre certificat de contrôle technique ainsi que tout document attestant de votre capacité à utiliser ce véhicule en tant que Conducteur sur la Plateforme ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ix) en cas d’empêchement ou de changement de l’horaire ou du Trajet en Covoiturage, en informer sans délais vos Passagers ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(x) en cas de Trajet en Covoiturage transfrontalier, disposer et tenir à disposition du Passager et de toute autorité qui le solliciterait tout document de nature à justifier de votre identité et de votre faculté à franchir la frontière ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(xi) attendre les Passagers sur le lieu de rencontre convenu au moins 15 minutes au-delà de l’heure convenue ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(xii) ne pas publier d’Annonce de Covoiturage relative à un véhicule dont vous n’êtes pas le propriétaire ou que vous n’êtes pas habilité à utiliser à des fins de covoiturage ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(xiii) vous assurer d’être joignable par téléphone par vos Passagers, au numéro enregistré sur votre profil ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(xiv) ne générer aucun bénéfice par l’intermédiaire de la Plateforme ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(xv) garantir n’avoir aucune contre-indication ou incapacité médicale à conduire ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(xvi) avoir un comportement convenable et responsable, au cours du Trajet en Covoiturage et conforme à l’esprit de covoiturage.\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"8.3. Engagements des Passagers\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"8.3.1. Lors d’un Trajet en Covoiturage\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Lorsque vous utilisez la Plateforme en tant que Passager dans le cadre d’un Trajet en Covoiturage, vous vous engagez à :\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(i) adopter un comportement convenable au cours du Trajet en Covoiturage de façon à ne gêner ni la concentration et la conduite du Conducteur ni la tranquillité des autres Passagers ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ii) respecter le véhicule du Conducteur et sa propreté ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iii) en cas d’empêchement, en informer sans délai le Conducteur ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iv) attendre le Conducteur sur le lieu de rencontre convenu au moins 15 minutes au-delà de l’heure convenue ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(v) communiquer à BlaBlaCar ou tout Conducteur qui vous en fait la demande, votre carte d’identité ou tout document de nature à attester de votre identité ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(vi) ne transporter, lors d’un Trajet en Covoiturage, aucun objet, marchandise, substance, animal de nature à gêner la conduite et la concentration du Conducteur ou dont la nature, la possession ou le transport est contraire aux dispositions légales en vigueur ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(vii) en cas de Trajet en Covoiturage transfrontalier, disposer et tenir à disposition du Conducteur et de toute autorité qui le solliciterait tout document de nature à justifier de votre identité et de votre faculté à franchir la frontière ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(viii) vous assurer d’être joignable par téléphone par le Conducteur, au numéro enregistré sur votre profil, notamment au point de rendez-vous.\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Dans le cas où vous auriez procédé à la Réservation d’une ou plusieurs Places pour le compte de tiers, conformément aux stipulations de l’article 4.2.3 ci-dessus, vous vous portez fort du respect par ce tiers des stipulations du présent article et, de façon générale, des présentes CGU. BlaBlaCar se réserve la possibilité de suspendre votre Compte, limiter votre accès aux Services ou résilier les présentes CGU, en cas de manquement de la part du tiers pour le compte duquel vous avez réservé une Place aux présentes CGU.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"8.3.2. Lors d’un Trajet en Bus\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Dans le cadre d’un Trajet en Bus, le Passager s’engage à se conformer aux conditions générales de l’Autocariste concerné.\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"9. Suspension de comptes, limitation d’accès et résiliation\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous avez la possibilité de mettre fin à votre relation contractuelle avec BlaBlaCar à tout moment, sans frais et sans motif. Pour cela, il vous suffit de vous rendre dans l’onglet « Fermeture de compte » de votre page Profil.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En cas de (i) violation de votre part des présentes CGU, notamment de vos obligations en tant que Membre mentionnées aux articles 6 et 8 ci-dessus, (ii) de dépassement du seuil visé à l’article 4.3.3. ci-dessus ou si (iii) BlaBlaCar a des raisons sérieuses de croire que ceci est nécessaire pour protéger sa sécurité et son intégrité, celles de ses Membres ou de tiers ou à des fins de prévention des fraudes ou d’enquêtes, BlaBlaCar se réserve la possibilité de :\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(i) résilier, immédiatement et sans préavis, les présentes CGU ; et/ou\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ii) empêcher la publication ou supprimer tout avis, Annonce, messages, contenus, demande de Réservation, ou tout contenu publié par vous sur la Plateforme ; et/ou\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iii) limiter votre accès et votre utilisation de la Plateforme ; et/ou\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iv) suspendre de façon temporaire ou permanente votre Compte.\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Lorsque cela est nécessaire, vous serez notifié de la mise en place d’une telle mesure afin de vous permettre de donner des explications à BlaBlaCar. BlaBlaCar décidera, à sa seule discrétion, de lever les mesures mises en place ou non.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"10. Données personnelles\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Dans le cadre de votre utilisation de la Plateforme, BlaBlaCar est amenée à collecter et traiter certaines de vos données personnelles. En utilisant la Plateforme et vous inscrivant en tant que Membre, vous reconnaissez et acceptez le traitement de vos données personnelles par BlaBlaCar conformément à la loi applicable et aux stipulations de la \"},{\"attributes\":{\"bold\":true,\"link\":\"https://www.blablacar.fr/about-us/privacy-policy\"},\"insert\":\"Politique de Confidentialité\"},{\"attributes\":{\"bold\":true},\"insert\":\".\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"11. Propriété intellectuelle\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"11.1. Contenu publié par BlaBlaCar\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Sous réserve des contenus fournis par ses Membres, BlaBlaCar est seule titulaire de l’ensemble des droits de propriété intellectuelle afférents au Service, à la Plateforme, à son contenu (notamment les textes, images, dessins, logos, vidéos, sons, données, graphiques) ainsi qu’aux logiciels et bases de données assurant leur fonctionnement.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar vous accorde une licence non exclusive, personnelle et non cessible d’utilisation de la Plateforme et des Services, pour votre usage personnel et privé, à titre non commercial et conformément aux finalités de la Plateforme et des Services.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous vous interdisez toute autre utilisation ou exploitation de la Plateforme et des Services, et de leur contenu sans l’autorisation préalable écrite de BlaBlaCar. Notamment, vous vous interdisez de :\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(i) reproduire, modifier, adapter, distribuer, représenter publiquement, diffuser la Plateforme, les Services et leur contenu, à l’exception de ce qui est expressément autorisé par BlaBlaCar ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ii) décompiler, procéder à de l’ingénierie inverse de la Plateforme ou des Services, sous réserve des exceptions prévues par les textes en vigueur ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iii) extraire ou tenter d’extraire (notamment en utilisant des robots d’aspiration de données ou tout autre outil similaire de collecte de données) une partie substantielle des données de la Plateforme.\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"11.2. Contenu publié par vous sur la Plateforme\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Afin de permettre la fourniture des Services et conformément à la finalité de la Plateforme, vous concédez à BlaBlaCar une licence non exclusive d’utilisation des contenus et données que vous fournissez dans le cadre de votre utilisation des Services (ci-après, votre « Contenu Membre »). Afin de permettre à BlaBlaCar la diffusion par réseau numérique et selon tout protocole de communication, (notamment Internet et réseau mobile), ainsi que la mise à disposition au public du contenu de la Plateforme, vous autorisez BlaBlaCar, pour le monde entier et pour toute la durée de votre relation contractuelle avec BlaBlaCar, à reproduire, représenter, adapter et traduire votre Contenu Membre de la façon suivante :\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(i) vous autorisez BlaBlaCar à reproduire tout ou partie de votre Contenu Membre sur tout support d’enregistrement numérique, connu ou inconnu à ce jour, et notamment sur tout serveur, disque dur, carte mémoire, ou tout autre support équivalent, en tout format et par tout procédé connu et inconnu à ce jour, dans la mesure nécessaire à toute opération de stockage, sauvegarde, transmission ou téléchargement lié au fonctionnement de la Plateforme et à la fourniture du Service ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ii) vous autorisez BlaBlaCar à adapter et traduire votre Contenu Membre, ainsi qu’à reproduire ces adaptations sur tout support numérique, actuel ou futur, stipulé au (i) ci-dessus, dans le but de fournir les Services, notamment en différentes langues. Ce droit comprend notamment la faculté de réaliser, dans le respect de votre droit moral, des modifications de la mise en forme de votre Contenu Membre aux fins de respecter la charte graphique de la Plateforme et/ou de le rendre techniquement compatible en vue de sa publication via la Plateforme.\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"12. Rôle de BlaBlaCar\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"La Plateforme constitue une plateforme en ligne de mise en relation sur laquelle les Membres peuvent créer et publier des Annonces de Covoiturage pour des Trajets en Covoiturage. Ces Annonces de Covoiturage ainsi que les Annonces de Bus peuvent notamment être consultées par les autres Membres pour prendre connaissance des modalités du Trajet et, le cas échéant, réserver directement une Place dans le véhicule concerné auprès du Membre ayant posté l’annonce sur la Plateforme ou de l’Autocariste.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En utilisant la Plateforme et en acceptant les présentes CGU, vous reconnaissez que BlaBlaCar n’est partie à aucun accord conclu entre vous et les autres Membres ou un Autocariste en vue de partager les frais afférents à un Trajet.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar n’a aucun contrôle sur le comportement de ses Membres, des Autocaristes et de leurs préposés, et des utilisateurs de la Plateforme. Elle ne possède pas, n’exploite pas, ne fournit pas, ne gère pas les véhicules objets des Annonces, ni ne propose le moindre Trajet sur la Plateforme.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous reconnaissez et acceptez que BlaBlaCar ne contrôle ni la validité, ni la véracité, ni la légalité des Annonces, des Places et Trajets proposés. En sa qualité d’intermédiaire en covoiturage, BlaBlaCar ne fournit aucun service de transport et n’agit pas en qualité de transporteur, le rôle de BlaBlaCar se limitant à faciliter l’accès à la Plateforme.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Dans le cadre d’un Trajet en Covoiturage, les Membres (Conducteurs ou Passagers) agissent sous leur seule et entière responsabilité, notamment conformément aux dispositions du code civil relatives au droit des obligations et à la responsabilité civile contractuelle (\"},{\"attributes\":{\"bold\":true,\"link\":\"https://www.legifrance.gouv.fr/affichCode.do?idArticle=LEGIARTI000032040787&idSectionTA=LEGISCTA000032040792&cidTexte=LEGITEXT000006070721&dateTexte=20180226\"},\"insert\":\"article 1101 et suivants\"},{\"attributes\":{\"bold\":true},\"insert\":\" du Code Civil).\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En sa qualité d’intermédiaire, BlaBlaCar ne saurait voir sa responsabilité engagée au titre du déroulement effectif d’un Trajet, et notamment du fait :\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(i) d’informations erronées communiquées par le Conducteur ou l’Autocariste, dans son Annonce, ou par tout autre moyen, quant au Trajet et à ses modalités ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ii) l’annulation ou la modification d’un Trajet par un Membre ou un Autocariste ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iii) le comportement de ses Membres pendant, avant, ou après le Trajet.\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"13. Fonctionnement, disponibilité et fonctionnalités de la Plateforme\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar s’efforcera, dans la mesure du possible, de maintenir la Plateforme accessible 7 jours sur 7 et 24 heures sur 24. Néanmoins, l’accès à la Plateforme pourra être temporairement suspendu, sans préavis, en raison d’opérations techniques de maintenance, de migration, de mises à jour ou en raison de pannes ou de contraintes liées au fonctionnement des réseaux.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En outre, BlaBlaCar se réserve le droit de modifier ou d’interrompre, à sa seule discrétion, de manière temporaire ou permanente, tout ou partie de l’accès à la Plateforme ou de ses fonctionnalités.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"14. Modification des CGU\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Les présentes CGU expriment l’intégralité de l’accord entre vous et BlaBlaCar relative à votre utilisation des Services. Tout autre document, notamment toute mention sur la Plateforme (FAQ, Blog, etc.), n’a qu’une valeur informative.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar pourra être amenée à modifier les présentes Conditions Générales d’Utilisation afin de s’adapter à son environnement technologique et commercial et afin de se conformer à la réglementation en vigueur. Toute modification des présentes CGU sera publiée sur la Plateforme avec une mention de la date de mise à jour et vous sera notifiée par BlaBlaCar avant son entrée en vigueur.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"15. Droit applicable – Litige\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Les présentes CGU sont rédigées en français et soumises à la loi française.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Vous pouvez également présenter, le cas échéant, vos réclamations relatives à notre Plateforme ou à nos Services, sur la plateforme de résolution des litiges mise en ligne par la Commission Européenne accessible \"},{\"attributes\":{\"bold\":true,\"link\":\"https://webgate.ec.europa.eu/odr/main/?event=main.home.show&lng=FR\"},\"insert\":\"ici\"},{\"attributes\":{\"bold\":true},\"insert\":\". La Commission Européenne se chargera de transmettre votre réclamation aux médiateurs nationaux compétents. Conformément aux règles applicables à la médiation, vous êtes tenus, avant toute demande de médiation, d’avoir fait préalablement part par écrit à BlaBlaCar de tout litige afin d’obtenir une solution amiable.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Conformément aux articles du code de la consommation L.611-1 et suivant, il est prévu que pour tout litige de nature contractuelle n’ayant pu être résolu dans le cadre d’une réclamation préalablement introduite auprès de notre service clients, vous pouvez, en votre qualité de consommateur, recourir gratuitement à la médiation en contactant l’Association Nationale des Médiateurs (ANM) soit par courrier en écrivant au 62, rue Tiquetonne 75002 PARIS soit par e-mail en remplissant le formulaire de saisine en ligne à l’adresse suivante: www.anm-conso.com\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Le site internet suivant www.economie.gouv.fr/mediation-conso comporte également toutes informations utiles en cas de litige transfrontalier.\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"16. Mentions légales\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"La Plateforme est éditée par la société Comuto SA, société anonyme au capital de 134.151,519 euros immatriculée au Registre du Commerce et des Sociétés de Paris, sous le numéro 491.904.546 (numéro de TVA intracommunautaire : FR76491904546) dont le siège social est situé au 84, avenue de la République – 75011 Paris (France) (email : support+fr@blablacar.com, tel : 01.85.76.22.27), représentée par son Directeur Général, Nicolas Brusson, Directeur de la publication du Site.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Le Site est hébergé sur les serveurs de Comuto SA.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Comuto SA est immatriculée au registre des opérateurs de voyages et de séjours sous le numéro suivant : IM075180037\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"La garantie financière est apportée par : Groupama Assurance-Crédit & Caution, 8-10 rue d’Astorg, 75008 Paris – France.\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"L’assurance de responsabilité civile professionnelle est souscrite auprès de : Hiscox Europe Underwriting Limited, 19, rue Louis Le Grand, 75002 Paris – France.\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Pour toute question, vous pouvez contacter Comuto SA en utilisant \"},{\"attributes\":{\"bold\":true,\"link\":\"https://www.blablacar.fr/contact\"},\"insert\":\"ce formulaire de contact.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"17. Carte « Total »\"},{\"attributes\":{\"header\":2},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"17.1. Description de l’opération\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Dans le cadre de la réglementation relative aux certificats d’économie d’énergie (CEE), BlaBlaCar et Total Marketing France (société par actions simplifiée au capital de 390 553 839,00 Euros, dont le siège social est situé au 562, avenue du parc de l’île, 92000 Nanterre, inscrite sous le numéro 531 680 445 au RCS Nanterre), vous permettent de participer à une opération vous faisant bénéficier d’une carte carburant ou d’une carte lavage, dans la limite des stocks disponibles.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Afin d’avoir un rôle actif et incitatif relatif à l’utilisation du covoiturage de façon régulière, Total Marketing France vous offre, sous réserve que vous remplissiez les conditions de l’offre (voir 17.2.ci-dessous), une carte carburant utilisable dans les stations-service du réseau accepteur aux marques TOTAL, TOTAL Access et ELAN en France métropolitaine et en Corse ou une carte lavage utilisable dans les stations-service du réseau accepteur à la marque Total Wash en France métropolitaine, hors Corse. La liste à jour des stations-service qui acceptent la carte carburant et la carte lavage ainsi que les conditions générales d’utilisation des cartes sont disponibles sur le site de Total à l’adresse suivante : \"},{\"attributes\":{\"bold\":true,\"link\":\"https://www.total.fr/pro/carte-gr/carte-jubileo/carte-cadeau-carburant\"},\"insert\":\"https://www.total.fr/pro/carte-gr/carte-jubileo/carte-cadeau-carburant\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"BlaBlaCar et/ou Total Marketing France se réservent la possibilité à tout moment de modifier, suspendre ou mettre fin à cette offre sous réserve de vous en informer.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"17.2. Conditions pour bénéficier de l’opération\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"L’opération est valable jusqu’au 31 décembre 2021. Vous ne pouvez bénéficier de cette opération qu’une seule fois et sous réserve que vous remplissiez l’ensemble des conditions suivantes :\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(i) vous résidez en France ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(ii) vous être inscrit sur le site www.blablacar.fr ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iii) vous avez publié, en tant que Conducteur, une Annonce pour un Trajet avec Réservation, dont au moins le point de départ ou le point d’arrivée est situé en France ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(iv) vous avez effectué tout ou partie du Trajet avec un Passager (que vous ne connaissiez pas avant le Trajet) ayant réglé le montant de la Participation aux Frais par l’intermédiaire de la Plateforme ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(v) vous avez renseigné sur votre profil votre adresse postale en France ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(vi) vous avez renseigné et verifié votre numéro de téléphone portable ;\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(vii) vous avez reçu, sur votre compte bancaire, le paiement la Participation aux Frais ; et\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"(viii) vous n’avez reçu aucune carte carburant ou carte lavage par l’intermédiaire de la Plateforme précédemment.\"},{\"attributes\":{\"align\":\"justify\",\"list\":\"bullet\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"L’ensemble de ces conditions doivent être remplies dans un délai de 10 mois maximum à compter de la date du premier Trajet réalisé avec le service de Réservation en ligne de la Plateforme et avant le 31 décembre 2021. Passé ce délai, vous perdez tout droit à prétendre à la carte carburant ou à la carte lavage.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"17.3. Contrôle du respect des conditions de l’opération\"},{\"attributes\":{\"header\":3},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"Les dispositions relatives à l’offre liée aux CEE ne sont applicables qu’une seule fois par Conducteur. Vous acceptez de répondre avec diligence à toute demande de BlaBlaCar en cas de contrôle du respect de cette condition.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"En absence de réponse satisfaisante à ces demandes, BlaBlaCar se réserve la possibilité de prendre toute mesure appropriée à votre encontre, notamment de suspendre votre Compte, limiter votre accès aux Services ou résilier les présentes CGU.\"},{\"attributes\":{\"align\":\"justify\"},\"insert\":\"\\n\"},{\"insert\":\"\\n\\n\\n\"}]}', '2021-03-07 16:50:21', '2021-03-07 17:01:55');
